import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <audio ref="audio_tag" src="http://localhost:4000/downloadmp3?url=https://www.youtube.com/watch?v=VHmojacY5YE" controls autoPlay />
    </div>
  );
}

export default App;
